var canvas = document.getElementById('canvas');
var ctx = canvas.getContext('2d');
let s = new Shapes(ctx);

canvas.width = innerWidth;
canvas.height = innerHeight;

var store1 = [], range = 5;
addEventListener('keypress', (e)=> {
	if (e.key == 'a') {

		let changes = false;
		let m = Math.min(store.length, store1.length);
		for (var i = 0; i < m; i++) {
			changes = false;
			if (store[i].c[0] < store1[i].c[0]) {
				changes = true;
				store[i].c[0] += range;
			}else if (store[i].c[0] > store1[i].c[0]) {
				changes = true;
				store[i].c[0] -= range;
			}
			//=====
			if (store[i].c[1] < store1[i].c[1]) {
				store[i].c[1] += range;
			}else if (store[i].c[1] > store1[i].c[1]) {
				store[i].c[1] -= range;
			}
			//=====
			if (store[i].c[2] < store1[i].c[2]) {
				store[i].c[2] += range;
			}else if (store[i].c[2] > store1[i].c[2]) {
				store[i].c[2] -= range;
			}
			//=====
			if (store[i].c[3] < store1[i].c[3]) {
				store[i].c[3] += range;
			}else if (store[i].c[3] > store1[i].c[3]) {
				store[i].c[3] -= range;
			}
			
			if (store[i] == undefined || store1[i] == undefined) {
				
				console.log('done')
				break;
			}
		}
	}
	animation();
});
addEventListener('resize', function(e) {
	canvas.width = innerWidth;
	canvas.height = innerHeight;
});

//============================================================================================================================
var store = [], radii = 2;
var imagedata, dat;
var img = new Image();
var red, green, blue, alpha;
var im = new Image();
var red1, green1, blue1, alpha1;

img.src = "data:image/png;base64,";
im.src = "data:image/png;base64,";


class Particle{
	constructor(x, y, color) {
		this.pos = new Vector2D(x, y);
		this.c = color;
		this.r = radii;
		this.Opos = new Vector2D(x, y);
	}
	
	draw() {
		s.box(this.pos.x-this.r/2, this.pos.y-this.r/2, this.r, this.r);
		s.fill(`rgba(${this.c[0]}, ${this.c[1]}, ${this.c[2]}, ${this.c[3]})`);
	}
	update() {
		this.draw();
	}
}

function imgLoad(imageD, s, scale) {
	ctx.setTransform(1, 0, 0, 1, 0, 0);
	ctx.clearRect(0, 0, canvas.width, canvas.height);
	s.length = 0;
	ctx.drawImage(imageD, 0, 0);
	//pixelPos();
	imagedata = ctx.getImageData(0, 0, imageD.width, imageD.height);
	dat = imagedata.data;
	ctx.clearRect(0, 0, canvas.width, canvas.height);
	//ctx.clearRect();
	for(var y = 0; y < imageD.height; y += radii) {
	  	for(var x = 0; x < imageD.width; x += radii) {
	  		red = dat[((imageD.width * y) + x) * 4];
	    	green = dat[((imageD.width * y) + x) * 4 + 1];
	    	blue = dat[((imageD.width * y) + x) * 4 + 2];
	    	alpha = dat[((imageD.width * y) + x) * 4 + 3];

	    	if (red !== 255 && green !== 255 && blue !== 255) {
		    	let clrAr = [red, green, blue, alpha];
		    	s.push(new Particle(x+scale, y+scale, clrAr));
	    	}
	 	}
	}
}
img.onload = () => {
	imgLoad(img, store, 200);
};
im.onload = () => {
	imgLoad(im, store1, 300);
	animation();
}

function animation() {
	ctx.setTransform(1, 0, 0, 1, 0, 0);
	ctx.clearRect(0, 0, canvas.width, canvas.height);

	store.forEach((balls) => {
		balls.update();
	});
	store1.forEach((balls) => {
		balls.update();
	});

}
